// import { toast, ToastContainer } from 'react-toastify'
import React from 'react'

const Icon = ({title='Null'}) => (
    <div className='circle'>
        {title}
    </div>
)

const Button = ({title='None'}) => (
    <div className='enter-button'>
        {title}
    </div>
)

export {Icon, Button};
